INSERT INTO cs_config VALUES('9','二维码生成规则','#{$mt2.id}#{$mt2.name}:网站：http://www.lpsyhfk.com/','','sms','[yyh]代表客户id号，[mz]代表客户姓名，[tel]是加密过的电话号码，推荐格式如：#[yyh]#开头以\"#\"包括方便系统扫描二维码，后面的可以随便。','sms_ewm');
