INSERT INTO cs_config VALUES('13','会员积分算法','0.05|0.15','','member','会员积分算法(消费积分|线下积分)，按会员总消费的百分比换算为积分，消费积分为会员的实际消费金额换算，线下积分为会员发展的线下客人消费金额百分比给予会员的奖励。','integral');
