INSERT INTO cs_config VALUES('17','挂号打印单设置','5|0|5|0|||0','<style type=\"text/css\"><!--\r\n*{padding:0;margin:0;font-size:12px;}\r\n#print{width: 453px;height: 286px;position:relative;overflow:hidden;}\r\n.info{position:absolute;width: 290px;height: 115px;top:115px;left:45px;}\r\nimg{float:left;border:0;}\r\n.ewm{width: 60px;height: 60px;position:absolute;left:340px;top:155px;z-index:5;}\r\n--></style><div id=\"print\"><img alt=\"\" src=\"images/gh.png\" /><img class=\"ewm\" title=\"二维码\" alt=\"\" src=\"{$mt2.ewm}\" /><div class=\"info\"><table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"290\" height=\"113\"><tbody><tr height=\"18\"><td width=\"70\">就诊号码：</td><td width=\"70\">{$mt2.id}</td><td width=\"70\">&nbsp;</td><td width=\"70\">&nbsp;</td></tr><tr height=\"18\"><td>姓&nbsp;&nbsp;名：</td><td>{$mt2.name}</td><td>姓&nbsp;&nbsp;别：</td><td>{$mt2.sex}</td></tr><tr height=\"18\"><td>年&nbsp;&nbsp;龄：</td><td>{$mt2.age}</td><td>联系电话：</td><td>{$mt2.tel}</td></tr><tr height=\"18\"><td>挂号日期：</td><td colspan=\"3\">{$mt2.time_cn}</td></tr></tbody></table></div></div>','print','<h3>参数说明：</h3>\r\n就诊号：{$mt2.id}<br/>\r\n预约号：{$mt2.infoid}<br/>\r\n客户姓名：{$mt2.name}<br/>\r\n客户电话：{$mt2.tel}<br/>\r\n客户年龄：{$mt2.age}<br/>\r\n客户性别：{$mt2.sex}<br/>\r\n初复诊：{$mt2.fz}<br/>\r\n挂号时间：{$mt2.time_cn}<br/>\r\n挂号项目：{$mt2.item}<br/>\r\n操作人：{$mt2.user}<br/>\r\n登记人：{$mt2.user2}<br/>\r\n渠道来源：{$mt2.canal}<br/>\r\n会员级别：{$mt2.vip}<br/>\r\n科室：{$mt2.department}<br/>\r\n医生：{$mt2.doctor}<br/>\r\n二维码地址：{$mt2.ewm}','printsell');
