INSERT INTO cs_doc VALUES('1','预约管理系统使用介绍','8','系统使用php编写，页面风格可以改模板文件tpl里的文件，，便可功能介绍：1，客户登记部分功能介绍客户登记，查找，预约到诊，预约提醒，客户分类回访，客户历史资料查询，短信发送2，到诊接待部分功能介绍到诊接待功能主要解决到诊接待不便，各种统计不便的问题，整体提升医院形象 ！3，到诊咨询部分功能介绍咨询派单，治疗项目预约，治疗项目派单，派单提醒，回访管理。4，财务收银部门功能介绍财务收银功能主要解决的是财务账目核算工作量大，收银管理混乱的难题！5，操作医院部门功能介绍操作医院主要包添加操作医院6，回访管理部门功能介绍回访管理主要包括顾客跟进回访、顾客满意度调查,。7，短信邮件发送功能8，提醒功能特别注意：IE须是IE8以上版本','1','#158e24,,1,6,','2013-10-11 17:59:38','2014-04-17 19:01:01');
INSERT INTO cs_doc VALUES('4','预约管理系统上线测试','8','<p align=\"center\"><span style=\"font-family:SimHei;font-size:32px;\">预约管理系统上线测试<strong></strong></span></p><p align=\"left\"><strong><span style=\"font-size:24px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 各位同事新版的预约管理系统上线测试了！请大家测试时如有疑问或者发现有错误的地方请及时告之。祝大家使用愉快！！<strong></strong></span></strong></p><p align=\"center\"><strong><span style=\"font-size:24px;\"><span style=\"font-size:24px;\"><strong><img alt=\"\" src=\"upload/doc/m_1310/201310221750007263.png\" /></strong></span></span></strong></p><p align=\"center\"><strong><span style=\"font-size:24px;\"><span style=\"font-size:24px;\"><strong><img alt=\"\" src=\"upload/doc/m_1310/201310221750144475.png\" /></strong></span></span></strong></p><p align=\"left\">&nbsp;</p><p align=\"center\">&nbsp;</p>','1','颜色,1,1,0,','2013-10-22 17:48:07','2013-11-04 17:34:13');
