INSERT INTO cs_info VALUES('1821','赵芳 ','女','','','0','18216820951','','','','0','9','32','0','27','0','2','6','妇科检查','0','0','0','<br/>----------------<br/>申丹--更改预约时间为：2014-04-23备注：04-19 16:42:02  友好妇科医院王医生正在和您进行对话..\r\n\r\n友好妇科医院王医生 04-19 16:42:02\r\n\r\n   欢迎您登陆友好医院网站，我院已开通网上预约挂号服务，凡网上预约的患者均可领取代金券200元。友好妇科医院院长携全体医务人员祝愿您早日康复。 \r\n\r\n \r\n\r\n友好妇科医院王医生 04-19 16:42:09\r\n\r\n您好，六盘水友好妇科医院，我是王医生，请问您有什么需要咨询的\r\n\r\n\r\n友好妇科医院王医生 04-19 16:42:14\r\n\r\n您好\r\n\r\n友好妇科医院王医生 04-19 16:42:18\r\n\r\n请问您有什么需要咨询了解的吗\r\n\r\n友好妇科医院王医生 04-19 16:42:19\r\n\r\n您请说\r\n\r\n贵州省贵阳市客人26 04-19 16:44:17\r\n\r\n你好，我昨晚跟老公同房后发现阴道瘙痒泛白，还有异味，小便刺痛，老公也有瘙痒的感觉怎么回事啊\r\n友好妇科医院王医生 04-19 16:44:20\r\n\r\n您年龄多大了呢？  这个情况是第一次出现呢 还是之前也出现过  \r\n\r\n贵州省贵阳市客人26 04-19 16:45:23\r\n\r\n第一次出现！以前也有但是不明显！也没在意，我今年24宝贝一岁半\r\n友好妇科医院王医生 04-19 16:45:27\r\n\r\n那您在出现这个情况以后今天有没有及时的到医院做过相关的检查这些呢？\r\n\r\n贵州省贵阳市客人26 04-19 16:46:01\r\n\r\n没有\r\n友好妇科医院王医生 04-19 16:46:18\r\n\r\n那王医生给您说   您这个就证明了一个问题  之前发现的话不是很严重 您就应该及时检查治疗的  现在又复发了 病情就会越来越严重  您这个情况妇科炎症应该蛮严重的 其次考虑阴道炎  尿路感染  但是具体的还得先需要到医院检查才能确诊知道吧\r\n\r\n友好妇科医院王医生 04-19 16:46:26\r\n\r\n我是王医生 您叫什么名字呢  现在在六盘水吗\r\n\r\n友好妇科医院王医生 04-19 16:46:54\r\n\r\n因为病情咱们一旦发现了如果觉得不严重就不及时检查的话  那么下次一旦发作的时候肯定就会更加严重\r\n\r\n贵州省贵阳市客人26 04-19 16:47:08\r\n\r\n嗯！下午得去贵阳三天以后回来！去谈工作\r\n友好妇科医院王医生 04-19 16:47:11\r\n\r\n您下午几点去贵阳呢？\r\n\r\n贵州省贵阳市客人26 04-19 16:47:37\r\n\r\n6点\r\n友好妇科医院王医生 04-19 16:47:44\r\n\r\n那王医生给您说嘛  检查就是10多分钟的时间  王医生现在给您免费安排预约一个专家号  您现在过来检查  检查了就直接从这里去火车站很近的可以吗\r\n\r\n友好妇科医院王医生 04-19 16:48:17\r\n\r\n王医生的电话是15121759524  您的是多少呢   您叫什么名字呢？\r\n\r\n贵州省贵阳市客人26 04-19 16:50:36\r\n\r\n18216820951赵芳，我想等回来以后再去看，现在可以用什么洗剂之类的吗？宝贝也在你们医院生的呢！觉得你们挺好的，就问问看！后天回来一定去\r\n友好妇科医院王医生 04-19 16:50:40\r\n\r\n小赵 您好    我是王医生    但是王医生考虑到您的这个期间情况不能在长时间拖了呀   到时候万一没有这个症状您又不检查了 那么下次在发的时候就越来越严重了知道吗  谢谢您对我们医院的许可  有什么不好的我们会积极的改正\r\n\r\n友好妇科医院王医生 04-19 16:50:57\r\n\r\n那您刚才不是给王医生说要3天以后吗？那您确定个时间嘛  王医生给您安排好吧\r\n\r\n友好妇科医院王医生 04-19 16:51:03\r\n\r\n工作王医生也能理解\r\n\r\n友好妇科医院王医生 04-19 16:51:12\r\n\r\n但是最好是在工作的时候咱们也不能忽视了身体就可以了\r\n\r\n友好妇科医院王医生 04-