INSERT INTO cs_visits VALUES('85','2003','05-01 09:06:59  友好妇科医院王医生正在和您进行对话..\r\n\r\n友好妇科医院王医生 05-01 09:06:59\r\n\r\n   欢迎您登陆友好医院网站，我院已开通网上预约挂号服务，凡网上预约的患者均可领取代金券200元。友好妇科医院院长携全体医务人员祝愿您早日康复。 \r\n\r\n \r\n\r\n贵州省六盘水市客人20 05-01 09:07:17\r\n\r\n你好\r\n友好妇科医院王医生 05-01 09:07:27\r\n\r\n你好 请说\r\n\r\n贵州省六盘水市客人20 05-01 09:08:51\r\n\r\n我想请问一下我月经结束一星期左右又有褐色分泌物，从褐色变成血了，量少，已经4天了\r\n贵州省六盘水市客人20 05-01 09:08:58\r\n\r\n这是怎么回事阿\r\n友好妇科医院王医生 05-01 09:09:05\r\n\r\n请提示一下年龄\r\n\r\n贵州省六盘水市客人20 05-01 09:09:23\r\n\r\n23岁\r\n友好妇科医院王医生 05-01 09:09:33\r\n\r\n你之前来过我们医院就诊过没有呢\r\n\r\n贵州省六盘水市客人20 05-01 09:09:43\r\n\r\n没有\r\n友好妇科医院王医生 05-01 09:10:01\r\n\r\n嗯 好的 那么你平时白带什么颜色 有瘙痒异味没有呢\r\n\r\n贵州省六盘水市客人20 05-01 09:10:49\r\n\r\n有时候很正常的，就是透明的，有时候也会出现白带里面有血丝的情况\r\n友好妇科医院王医生 05-01 09:11:07\r\n\r\n 白带里面夹带血丝是性生活以后出现的 是吧\r\n\r\n友好妇科医院王医生 05-01 09:11:11\r\n\r\n我是王医生 怎么称呼你呢\r\n\r\n贵州省六盘水市客人20 05-01 09:11:32\r\n\r\n异味没发现，经常洗澡的\r\n贵州省六盘水市客人20 05-01 09:11:51\r\n\r\n我姓高\r\n贵州省六盘水市客人20 05-01 09:12:25\r\n\r\n我也搞不清楚，有性生活的，订婚了没结婚\r\n友好妇科医院王医生 05-01 09:13:25\r\n\r\n小高 你好 是这样哈 根据你所描述的情况来看  不排除有宫颈糜烂的可能  因为接触性出血是比较典型的症状了\r\n\r\n友好妇科医院王医生 05-01 09:13:44\r\n\r\n这个需要做个电子阴道镜静和白带检查确诊的\r\n\r\n贵州省六盘水市客人20 05-01 09:13:52\r\n\r\n这很严重是吗？\r\n友好妇科医院王医生 05-01 09:14:25\r\n\r\n是这样 我们医院针对5.1做活动 有预约的情况下免挂号费  很多妇科检查就是5.1元钱的  你留个全名和电话号码 我给你挂个免费号 你来检察一下  \r\n\r\n贵州省六盘水市客人20 05-01 09:14:37\r\n\r\n我现在都淅淅沥沥的有点血可以检查吗？\r\n友好妇科医院王医生 05-01 09:15:15\r\n\r\n可以检查 如果是宫颈糜烂都有血的 你还没结婚 生孩子 这个肯定要重视 明白吧\r\n\r\n友好妇科医院王医生 05-01 09:15:28\r\n\r\n我的电话号码是15585883111  你的多少呢 \r\n\r\n贵州省六盘水市客人20 05-01 09:15:41\r\n\r\n喔喔，那可以，什么时候过来检查呢\r\n贵州省六盘水市客人20 05-01 09:15:53\r\n\r\n18604506991\r\n友好妇科医院王医生 05-01 09:15:57\r\n\r\n你留个全名和电话号码 我现在给你挂号 你现在过来  \r\n\r\n贵州省六盘水市客人20 05-01 09:16:06\r\n\r\n高炯\r\n友好妇科医院王医生 05-01 09:16:57\r\n\r\n高炯   23岁 你核对一下挂号信息\r\n友好妇科医院王医生 05-01 09:17:14\r\n\r\n你知道我们医院的地址不呢\r\n贵州省六盘水市客人20 05-01 09:17:14\r\n\r\n王医生，我想问这种情况很严重吗？治疗费用怎么样？\r\n贵州省六盘水市客人20 05-01 09:17:28\r\n\r\n嗯，信息对的\r\n贵州省六盘水市客人20 05-01 09:17:45\r\n\r\n知道，我有个朋友在那边当编辑\r\n友好妇科医院王医生 05-01 09:17:54\r\n\r\n 嗯  宫颈糜烂会影响你正常受孕 但是也不是大问题 我们对症治疗 不严重用药物治疗  严重一点用物理治疗就可以 \r\nY-蒋-高炯-宫颈糜烂 05-01 09:18:32\r\n\r\n喔，那可以痊愈吗？\r\nY-蒋-高炯-宫颈糜烂 05-01 09:19:06\r\n\r\n我工作比较忙，这几天都要加班，中午时间或者6点之后过来可以吗？\r\n友好妇科医院王医生 05-01 09:19:12\r\n\r\n可以的  这个最严重的情况下就是做LEEP刀手术 一次性可根治的 你先来检查再说  你中午过来吧    我们中午不休息的 \r\n友好妇科医院王医生 05-01 09:19:22\r\n\r\n我把你的预约号发给你\r\nY-蒋-高炯-宫颈糜烂 05-01 09:19:38\r\n\r\n嗯，打电话给你就可以了是吗？\r\n友好妇科医院王医生 05-01 09:19:43\r\n\r\n你过来以后首先在2楼导诊台护士那里登记名字 高炯  你跟护士说你是网络预约挂号的\r\n友好妇科医院王医生 05-01 09:19:59\r\n\r\n这样护士核实信息免挂号费  给你一张200优惠劵 直接带你过来的\r\nY-蒋-高炯-宫颈糜烂 05-01 09:20:09\r\n\r\n好的\r\nY-蒋-高炯-宫颈糜烂 05-01 09:20:32\r\n\r\n喔喔，好的\r\n友好妇科医院王医生 05-01 09:20:41\r\n\r\n你的电话号码是对的哈\r\nY-蒋-高炯-宫颈糜烂 05-01 09:20:48\r\n\r\n谢谢\r\nY-蒋-高炯-宫颈糜烂 05-01 09:20:53\r\n\r\n对的\r\nY-蒋-高炯-宫颈糜烂 05-01 09:21:15\r\n\r\n对了需要带钱过去吗？\r\n友好妇科医院王医生 05-01 09:21:39\r\n\r\n嗯  检查费用是要的 一般就是几十元钱的 ','','2014-05-01','0','23');
