\n友好妇科医院王医生 05-16 20:35:34\r\n\r\n起码要面对面的问诊 这样更加详细一些\r\n\r\n贵州省六盘水市客人19 05-16 20:35:39\r\n\r\n好的  \r\n贵州省六盘水市客人19 05-16 20:35:43\r\n\r\n谢谢 \r\n友好妇科医院王医生 05-16 20:35:49\r\n\r\n这样吧 您留个全名 还有联系方式 \r\n\r\n贵州省六盘水市客人19 05-16 20:36:04\r\n\r\n谢谢您  \r\n友好妇科医院王医生 05-16 20:36:22\r\n\r\n我这里给您安排明天主任的专家号\r\n\r\n友好妇科医院王医生 05-16 20:36:49\r\n\r\n您明天过来就不用排队 直接是妇科主任直接给您接诊了\r\n\r\n贵州省六盘水市客人19 05-16 20:37:03\r\n\r\n我看一下 如果 明天有时间  我就过去\r\n友好妇科医院王医生 05-16 20:37:27\r\n\r\n那我这里先保留一个专家号 先不安排上去 稍后我发预约号给您好吧\r\n\r\n友好妇科医院王医生 05-16 20:37:38\r\n\r\n这样的话 您过来提前给我打个电话就行\r\n\r\n友好妇科医院王医生 05-16 20:37:46\r\n\r\n这样的话 时间上面 非常灵活\r\n\r\n贵州省六盘水市客人19 05-16 20:37:53\r\n\r\n好的 \r\n友好妇科医院王医生 05-16 20:37:55\r\n\r\n您过来的话 就可以直接就诊 \r\n\r\n友好妇科医院王医生 05-16 20:38:18\r\n\r\n您只有收到我发过来的预约短信 您看专家号是免费的\r\n\r\n友好妇科医院王医生 05-16 20:39:07\r\n\r\n那您告诉我一下联系方式 我把短信发过来呢\r\n\r\n友好妇科医院王医生 05-16 20:39:51\r\n\r\n我这边给您申请了一张200元的优惠劵 是可以用于抵消一部分手术 或者是治疗费用的\r\n\r\n客人对本次对话作出评价,选择的条目是: 非常满意\r\n\r\n友好妇科医院王医生 05-16 20:40:16\r\n\r\n明天您收到预约短信之后 就可以在二楼导医台领取\r\n\r\n贵州省六盘水市客人19 05-16 20:40:31\r\n\r\n15761644898\r\n友好妇科医院王医生 05-16 20:40:48\r\n\r\n我现在能否打个电话给您交代一下怎么去登记呢？》\r\n\r\n贵州省六盘水市客人19 05-16 20:41:27\r\n\r\n这个  就不用了  谢谢\r\n05-16 20:41:34  对话窗口被关闭，对话已结束。\r\n','','2014-05-16','0','27');
