INSERT INTO cs_visits VALUES('263','2464','2014-05-25 22:08:34 进入:/swt.html\r\n05-25 22:08:35  友好妇科医院王医生正在和您进行对话..\r\n\r\n友好妇科医院王医生 05-25 22:08:35\r\n\r\n   欢迎您登陆友好医院网站，我院已开通网上预约挂号服务，凡网上预约的患者均可领取代金券200元。友好妇科医院院长携全体医务人员祝愿您早日康复。 \r\n\r\n \r\n\r\n友好妇科医院王医生 05-25 22:08:40\r\n\r\n您好，六盘水友好妇科医院，我是王医生，请问您有什么需要咨询的吗？\r\n\r\n\r\n贵州省六盘水市客人27 05-25 22:09:06\r\n\r\n请问医生做人流的话大概什么时间段最适合\r\n友好妇科医院王医生 05-25 22:09:09\r\n\r\n您年龄多大了呢？\r\n\r\n友好妇科医院王医生 05-25 22:09:13\r\n\r\n末次月经是几月几号\r\n\r\n停留0分57秒后 22:09:31 进入:/swt.html\r\n贵州省六盘水市客人27 05-25 22:10:07\r\n\r\n请问做人流大概什么时候最适合\r\n友好妇科医院王医生 05-25 22:10:11\r\n\r\n我问您多大年龄了  末次月经是几月几号 没有收到 \r\n\r\n友好妇科医院王医生 05-25 22:10:12\r\n\r\n吗\r\n\r\n友好妇科医院王医生 05-25 22:11:16\r\n\r\n还在线吗\r\n\r\n贵州省六盘水市客人27 05-25 22:11:32\r\n\r\n在\r\n友好妇科医院王医生 05-25 22:11:40\r\n\r\n那我问您怎么都不说话呢\r\n\r\n贵州省六盘水市客人27 05-25 22:11:57\r\n\r\n末月经好像是在上个月二十号\r\n友好妇科医院王医生 05-25 22:11:59\r\n\r\n是给您本人咨询的吗？\r\n\r\n贵州省六盘水市客人27 05-25 22:12:09\r\n\r\n才收到不好意思，是本人\r\n友好妇科医院王医生 05-25 22:12:17\r\n\r\n那就是怀孕35天了   宝宝和爱人商量确定好不要了吗\r\n\r\n友好妇科医院王医生 05-25 22:12:26\r\n\r\n之前有在我们医院就诊过没有\r\n\r\n贵州省六盘水市客人27 05-25 22:12:30\r\n\r\n确定了\r\n贵州省六盘水市客人27 05-25 22:12:44\r\n\r\n没有，是先咨询\r\n友好妇科医院王医生 05-25 22:13:05\r\n\r\n那您这个情况得先过来医院做一下B超看一下孕囊的情况及排除宫外孕和葡萄胎的可能 到时候才能安排适合您的人流手术方式\r\n\r\n友好妇科医院王医生 05-25 22:13:16\r\n\r\n因为人流都是越早做越好 只要看见孕囊就可以做了\r\n\r\n友好妇科医院王医生 05-25 22:13:26\r\n\r\n我是王医生  请问您全名怎么称呼呢  现在在六盘水的是吗\r\n\r\n贵州省六盘水市客人27 05-25 22:13:48\r\n\r\n那好！知道了！谢谢医生！现在在六盘水，全名是黄玉\r\n友好妇科医院王医生 05-25 22:13:59\r\n\r\n小黄您好 我是王医生\r\n\r\n贵州省六盘水市客人27 05-25 22:14:05\r\n\r\n那大概要多少手术费呢\r\n友好妇科医院王医生 05-25 22:14:29\r\n\r\n那您现在也是在六盘水的  您看这样可以吗 王医生给您安排预约一个专家号  您明天先过来咱们做个检查看一下就能知道全部要多少费用了\r\n\r\n贵州省六盘水市客人27 05-25 22:14:31\r\n\r\n王医生，您好谢谢你的耐心解答\r\n友好妇科医院王医生 05-25 22:14:43\r\n\r\n我们医院的话人流手术费用有898 980 1280 2200的这几种 得先检查哦\r\n\r\n友好妇科医院王医生 05-25 22:14:59\r\n\r\n不用这么客气 这是我们应该做的  王医生的电话是15121759524  您的是多少呢\r\n\r\n贵州省六盘水市客人27 05-25 22:15:12\r\n\r\n明天的话，我没时间，我是住六盘水的，但是要过几天才过去，现在在外面呢\r\n贵州省六盘水市客人27 05-25 22:15:27\r\n\r\n18212580102\r\n友好妇科医院王医生 05-25 22:15:32\r\n\r\n现在在外面哪里呢？那是您准备多少号才过来呢\r\n\r\n贵州省六盘水市客人27 05-25 22:16:43\r\n\r\n大概六月几号，现在在毕节，还在这边有事\r\n友好妇科医院王医生 05-25 22:16:51\r\n\r\n要6月份才能来啊   王医生建议您是越早越好吧 \r\n\r\n贵州省六盘水市客人27 05-25 22:17:38\r\n\r\n嗯！知道，我尽量过来早点\r\n友好妇科医院王医生 05-25 22:17:54\r\n\r\n嗯\r\n\r\n友好妇科医院王医生 05-25 22:18:02\r\n\r\n那我给您安排在5号之前吧好吗\r\n\r\n友好妇科医院王医生 05-25 22:18:08\r\n\r\n您可以的话最好早点过来\r\n\r\n贵州省六盘水市客人27 05-25 22:18:56\r\n\r\n嗯，好\r\n友好妇科医院王医生 05-25 22:19:14\r\n\r\n知道我们医院地址吗\r\n\r\n贵州省六盘水市客人27 05-25 22:19:20\r\n\r\n谢谢您了\r\nY-申-黄玉-早孕检查 05-25 22:19:57\r\n\r\n知道\r\nY-申-黄玉-早孕检查 05-25 22:20:50\r\n\r\n这几天肚子痛是正常的么\r\n友好妇科医院王医生 05-25 22:21:17\r\n\r\n那您这个情况得抓紧到医院检查了\r\n\r\nY-申-黄玉-早孕检查 05-25 22:22:32\r\n\r\n只是腰酸，会偶尔痛一下\r\n友好妇科医院王医生 05-25 22:22:50\r\n\r\n那您等下注意接收预约短信 到时候确定了时间提前给王医生打个电话\r\n\r\n友好妇科医院王医生 05-25 22:23:36\r\n\r\n到时候到了医院以后直接上来我们医院2楼导诊台提示名字和联系电话说是网上预约好的就可以了 还可以凭王医生给您发的短信领取优惠劵 所以别把这条短信给删除了平\r\n\r\n友好妇科医院王医生 05-25 22:23:37\r\n\r\n哦\r\n\r\nY-申-黄玉-早孕检查 05-25 22:24:16\r\n\r\n嗯，好的\r\n友好妇科医院王医生 05-25 22:24:31\r\n\r\n那您早点休息\r\n\r\n友好妇科医院王医生 05-25 22:29:27\r\n\r\n小黄 您收到王医生发的短信了吗？\r\n\r\n05-25 22:32:05  对话窗口关闭，对话已结束。\r\n','','2014-05-25','0','32');
